import { create } from "zustand";

const useCartStore = create((set) => ({
  amount: 0,
  itemList: [
    { name: "감자", price: 5000 },
    { name: "고구마", price: 6000 },
    { name: "당근", price: 4000 },
  ],
  setAmount: (amount) => set({ amount }),
}));

export default useCartStore;
